{ const [pressed,setPressed]=useState("");
  return(
    <div class="modal">
    <div class="modal_content">
        <span  onClick={() => setPressed(!pressed)}>
            <FaTimes className="Close" />
        </span>
        
        <button
            className="UpdateButton"
            //onClick={handleClickOnAddButton}
            >
            Update
        </button>
     </div>
   </div >
  );
}
export default popupreq;
